import React, { useEffect, useState } from 'react'
import { View, Text , StyleSheet} from "react-native"
import { shadowColor } from 'react-native/Libraries/Components/View/ReactNativeStyleAttributes';


export default function Home() {
    const [objUser, setObjUser] = useState({})
    const getMoviesFromApi = () => {
        return fetch('https://api.github.com/users/witillan')
            .then((resposta) => resposta.json())
            .then((r) => {
                setObjUser(r)
                return r
            })
            .catch((error) => {
                alert(`Ocorreu um erro ${error.text()} ao buscar o usuÃ¡rio na API do "Github"`);
            })
    };

    useEffect(() => {
        getMoviesFromApi()
    }, [])

    return (
        <View style={styles.container}>
            <View></View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center'
    },
    card: {
        borderColor: 5,
        backgroundColor: 'green',
        shadowColor: '#000000CC'
    }
  });
